package UT2;

public class D2016_10_03_ej4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		byte m=2;
		byte n=5;
		boolean res=(m<n);
			System.out.println("'m' menor que 'n' es: " +res);
		res=(m>n);
			System.out.println("'m' mayor que 'n' es: " +res);
		res=(m<=n);
			System.out.println("'m' menor o igual que 'n' es: " +res);
		res=(m>=n);
			System.out.println("'m' mayor o igual que 'n' es: " +res);
		res=(m==n);
			System.out.println("'m' igual a 'n' es: " +res);
		res=(m!=n);
			System.out.println("'m' distinto de 'n' es: " +res);
			
		//end							
	}			
	 
}
